INSERT INTO `livrosonline`.`TBLIVRO` VALUES  (1,'Agile Software Development, Principles, Patterns and Principles','Robert C. Martin','978-0135974445','Prentice Hall; 1ª Edição',529,'Inglês','122.35',2002,'Written by a software developer for software developers, this book is a unique collection of the latest software development methods. The author includes OOD, UML, Design Patterns, Agile and XP methods with a detailed description of a complete software design for reusable programs in C++ and Java. Using a practical, problem-solving approach, it shows how to develop an object-oriented application--from the early stages of analysis, through the low-level design and into the implementation. Walks readers through the designer\'s thoughts -- showing the errors, blind alleys, and creative insights that occur throughout the software design process. The book covers: Statics and Dynamics; Principles of Class Design; Complexity Management; Principles of Package Design; Analysis and Design; Patterns and Paradigm Crossings. Explains the principles of OOD, one by one, and then demonstrates them with numerous examples, completely worked-through designs, and case studies. Covers traps, pitfalls, and work arounds in the application of C++ and OOD and then shows how Agile methods can be used. Discusses the methods for designing and developing big software in detail.Features a three-chapter, in-depth, single case study of a building security system.  For Software Engineers, Programmers, and Analysts who want to understand how to design object oriented software with state of the art methods.\n  \n<br/><br/>\n      <b>From the Back Cover</b><br/>\n  <p> Best selling author and world-renowned software development expert Robert C. Martin  shows how to solve the most challenging problems facing software developers, project  managers, and software project leaders today. </p>  <ul> <b>This comprehensive, pragmatic tutorial on Agile Development and eXtreme  programming, written by one of the founding father of Agile  Development:</b><br/> <li>Teaches software developers and project managers how to get  projects done on time, and on budget using the power of Agile  Development.</li> <li>Uses real-world case studies to show how to of plan, test, refactor,  and pair program using eXtreme programming.</li> <li>Contains a wealth of reusable C++ and Java code.</li> <li>Focuses on solving customer oriented systems problems using UML  and Design Patterns.</li> </ul> ',1,),
 (2,'Clean Code: A Handbook of Agile Software Craftsman','Robert C. Martin','978-0132350884','Prentice Hall',464,'Inglês','75.87',2008,'  Even bad code can function. But if code isn’t clean, it can bring a development organization to its knees. Every year, countless hours and significant resources are lost because of poorly written code. But it doesn’t have to be that way.<br/><br/>Noted software expert Robert C. Martin presents a revolutionary paradigm with <i><b>Clean Code: A Handbook of Agile Software Craftsmanship</b></i>. Martin has teamed up with his colleagues from Object Mentor to distill their best agile practice of cleaning code “on the fly” into a book that will instill within you the values of a software craftsman and make you a better programmer—but only if you work at it.<br/><br/>What kind of work will you be doing? You’ll be reading code—lots of code. And you will be challenged to think about what’s right about that code, and what’s wrong with it. More importantly, you will be challenged to reassess your professional values and your commitment to your craft.<br/><br/><i><b>Clean Code</b></i> is divided into three parts. The first describes the principles, patterns, and practices of writing clean code. The second part consists of several case studies of increasing complexity. Each case study is an exercise in cleaning up code—of transforming a code base that has some problems into one that is sound and efficient. The third part is the payoff: a single chapter containing a list of heuristics and “smells” gathered while creating the case studies. The result is a knowledge base that describes the way we think when we write, read, and clean code.<br/><br/>Readers will come away from this book understanding<br/><ul><li>How to tell the difference between good and bad code</li><li>How to write good code and how to transform bad code into good code</li><li>How to create good names, good functions, good objects, and good classes</li><li>How to format code for maximum readability</li><li>How to implement complete error handling without obscuring code logic</li><li>How to unit test and practice test-driven development</li></ul>This book is a must for any developer, software engineer, project manager, team lead, or systems analyst with an interest in producing better code.',4,);
INSERT INTO `livrosonline`.`TBLIVRO` VALUES  (3,'Agile Software Development with Scrum','Ken Schwaber e Mike Beedle ','978-0130676344','Prentice Hall',159,'Inglês','80.23',2001,'eXtreme Programming is an ideal many software shops would love to reach, but with the constant pressures to produce software quickly, they cannot actually implement it. The Agile software process allows a company to implement eXtreme Programming quickly and immediately-and to begin producing software incrementally in as little as 30 days! Implementing eXtreme Programming is easier said than done. The process can be time consuming and actually slow down current software projects that are in process. This book shows readers how to use SCRUM, an Agile software development process, to quickly and seamlessly implement XP in their shop-while still producing actual software. Using SCRUM and the Agile process can virtually eliminate all downtime during an XP implementation.\n',1,),
 (4,'Ruby On Rails: Desenvolvimento Facil E Rapido De Aplicações Web','Rodrigo Urubatan','978-8575221846','Novatec',288,'Portugues','63.99',2009,'Ruby é uma linguagem bastante popular para automação de tarefas e também para desenvolvimento de aplicações web. \'Ruby On Rails\' é um metaframework gratuito, de código aberto e desenvolvido em Ruby para desenvolvimento de aplicações web, seguindo a arquitetura MVC (Model-View-Controler). O objetivo principal deste livro é fornecer ao leitor uma fonte de referência com exemplos passo a passo de como utilizar este framework, com o embasamento teórico necessário, mas focando no lado prático, podendo ser utilizado como primeiro contato com o framework ou como referência técnica para profissionais.',2,);
INSERT INTO `livrosonline`.`TBLIVRO` VALUES  (5,'Seam Framework: Experience the Evolution of Java EE','Michael Juntao Yuan','978-0137129393','Prentice Hall PTR',504,'Inglês','50.82',2009,'<p style=\"margin: 0px;\"><b>Fully Updated to Cover Major Enhancements to Seam 2.x</b></p>  <p style=\"margin: 0px;\"><b> </b></p>  <p style=\"margin: 0px;\">In <b><i>Seam Framework, Second Edition, </i></b>the authors of the leading guide to Seam programming have systematically updated their text to reflect the major improvements introduced with Seam 2.x. This author team–all key Seam project contributors–teach Seam 2.x through detailed example applications that reveal how Seam simplifies many tasks that were previously difficult or impractical. Their robust descriptions are complemented by in-depth feature discussions that demonstrate how to use Seam’s power to the fullest. Whether you’re new to Seam programming or a seasoned Seam developer who wants to achieve deeper mastery of Seam 2.x, this book will be an indispensable resource.</p>  <p style=\"margin: 0px;\"> </p>  <p style=\"margin: 0px;\">Coverage includes</p>  <ul>  <li>Using improvements to Seam’s conversation model, transaction management, and other features</li>  <li>Enhancing security, performing end-to-end validation, and providing custom exception pages</li>  <li>Using Quartz to execute timer jobs in your application</li>  <li>Generating bookmarkable RESTful Web pages the easy way</li>  <li>Developing highly scalable applications with Seam 2.x’s new multilayer caching</li>  <li>Simplifying development with Groovy, the scripting language that runs directly on the JVM</li>  <li>Using jBPM business processes to improve page flow</li>  <li>Previewing Web Beans (JSR-299), the future core of Seam that will transform Java EE Web development</li></ul>  <p style=\"margin: 0px;\"> </p>  <p style=\"margin: 0px;\">*<b>Download source code for this book’s case study application at solutionsfit.com/seam.</b></p>',3,),
 (6,'Seam in Action','Dan Allen','978-1933988405','Manning',624,'Inglês','85.87',2008,'JBoss Seam is an exciting new application framework based on the Java EE platform that is used to build rich, web-based business applications. Seam is rapidly capturing the interest of Java enterprise developers because of its focus on simplicity, ease of use, transparent integration, and scalability.  <p>  <i>Seam in Action</i> offers a practical and in-depth look at JBoss Seam. The book puts Seam head-to-head with the complexities in the Java EE architecture. The author presents an unbiased view of Seam from outside the walls of RedHat/JBoss, focusing on such topics as Spring integration and deployment to alternative application servers to steer clear of vendor lock-in. By the end of the book, you should expect to not only gain a deep understanding of Seam, but also come away with the confidence to teach the material to others.  </p><p>  To start off, you will see a working Java EE-compliant application come together by the end of the second chapter. As you progress through the book, you will discover how Seam eliminates unnecessary layers and configurations, solves the most common JSF pain points, and establishes the missing link between JSF, EJB 3 and JavaBean components. The author also shows you how Seam opens doors for you to incorporate technologies you previously have not had time to learn, such as business processes and stateful page flows (jBPM), Ajax remoting, PDF generation, asynchronous tasks, and more.  </p><p>  All too often, developers spend a majority of their time integrating disparate technologies, manually tracking state, struggling to understand JSF, wrestling with Hibernate exceptions, and constantly redeploying applications, rather than on the logic pertaining to the business at hand. <i>Seam in Action</i> dives deep into thorough explanations of how Seam eliminates these non-core tasks by leveraging configuration by exception, Java 5 annotations, and aspect-oriented programming.',3,);
